import React, { Component } from 'react'

export default class SeeTalk extends Component {

  state = {
    title: '',
    image: '',
    talk: ''
  }

  componentDidMount() {

    if (this.props.location.state !== undefined) {
      this.setState({
        title: this.props.location.state.title,
        image: this.props.location.state.image,
        talk: this.props.location.state.talk
      })
    }


  }

  render() {
    console.log(this.props.localtion.state)
    const { title, talk, image } = this.state

    return (
      <div className='App'>
        <h1>title {title}</h1>
        <div><img src={image} alt="hamster"/></div>
        <p>{talk}</p>
      </div>
    )
  }
}
